import React, {useState, useEffect} from "react";

const RentalCard = ({ property }) => {

  const fetchZillowData = async () => {
    const url =
      "https://zillow56.p.rapidapi.com/search?location=houston%2C%20tx";
    const options = {
      method: "GET",
      headers: {
        "X-RapidAPI-Key": "23e106927emsh4f983bf11157d33p1c8f12jsn0e27e88bb61a",
        "X-RapidAPI-Host": "zillow56.p.rapidapi.com",
      },
    };

    try {
      const response = await fetch(url, options);
      const result = await response.json(); // Parse JSON response
      setProperties(result.results);

    } catch (error) {
      console.error("Error fetching data:", error);

    }
  };

  useEffect(() => {
    fetchZillowData();
  }, []);

  return (
    <div className="rental-card">
      <img src={property.imageSrc} alt={property.streetAddress} />
      <h2>{property.streetAddress}</h2>
      <p>{property.city}</p>
      <p>{property.price.toLocaleString()}</p>
    </div>
  );
};

export default RentalCard;
